function postponeItems(items, days) {
  const now = Date.now();
  const newdue = days ? now + days * DateUtils.DAYS_TO_MILLIS : void 0;
  let fltItems = items.filter((item) => item.isTracked);
  const safe_fltItems = fltItems.filter((item) => item.nextReview < globalDateProvider.startofToday.valueOf()).sort((a, b2) => currentRetention(a) - currentRetention(b2)).filter((item) => {
    console.debug("current R:", currentRetention(item), 1 / currentRetention(item) - 1);
    return currentRetention(item) > 0.65;
  });
  const safe_cnt = safe_fltItems.length;
  fltItems = days > 0 ? fltItems : safe_fltItems;
  debug("postpone", 0, { safe_cnt, days });
  postpone(fltItems, newdue);
  return items;
}
function elapsed_days(item) {
  const delay = (Date.now() - item.nextReview) / DateUtils.DAYS_TO_MILLIS;
  return item.interval + delay;
}
function currentRetention(item) {
  return Math.pow(1 + elapsed_days(item) / (9 * item.interval), -1);
}
function postpone(items, newdue) {
  let cnt = 0;
  items.map((item) => {
    let newitvl;
    const olastview = item.hasDue ? item.nextReview - item.interval * DateUtils.DAYS_TO_MILLIS : Date.now();
    if (newdue) {
      newitvl = newdue - olastview;
    } else {
      const delay = (Date.now() - olastview) / DateUtils.DAYS_TO_MILLIS - item.interval;
      newitvl = Math.min(
        Math.max(1, Math.ceil(item.interval * (1.05 + 0.05 * Math.random())) + delay),
        36500
      );
    }
    if (newdue || newitvl !== item.interval) {
      cnt++;
      item.updateDueByInterval(newitvl, newdue);
    }
    console.debug(newdue, newitvl, item.interval);
  });
  debug("postpone", 0, { cnt });
  return items;
}

// src/algorithms/balance/reschedule.ts
function reschedule(items) {
  let reCnt = 0;
  console.group("reschedule");
  if (items[0].isFsrs) {
    const result = reschedule_fsrs(items);
    reCnt = result.reCnt;
  } else {
    reCnt = reschedule_default(items).reCnt;
  }
  console.groupEnd();
  debug("reschedule", 0, { items, reCnt });
  return items;
}
function reschedule_default(items) {
  let reCnt = 0;
  items.map((item) => {
    const interval = item.interval * 9 * (1 / 0.9 - 1);
    const newitvl = Math.min(Math.max(Math.round(interval), 1), 3650);
    if (newitvl !== item.interval) {
      reCnt++;
      item.updateDueByInterval(newitvl);
    }
  });
  return { items, reCnt };
}
function reschedule_fsrs(items) {
  let reCnt = 0;
  const fsrs = SrsAlgorithm.getInstance().fsrs;
  items.map((item) => {
    if (!item.isTracked)
      return;
    const data = item.data;
    const newitvl = fsrs.next_interval(data.stability);
    if (newitvl !== data.scheduled_days) {
      reCnt++;
      item.updateDueByInterval(newitvl);
    }
  });
  return { items, reCnt };
}

